import React from 'react';


const AvailableItem = ({ label, onToggleImportant, onToggleDone, onDelete }) => {


    return (
        <span >
      <span
          className=""
          onClick={onToggleDone}>{label}</span>

      <button type="button"
              className="btn-primary"
              onClick={onToggleImportant}> Rent </button>

      <button type="button"
              className="btn-danger"
              onClick={onDelete}> Delete </button>
    </span>
    );
};

export default AvailableItem;
